import React, { useState } from 'react';
import Calendar from 'react-calendar';
import { VictoryChart, VictoryLine } from 'victory';
import swal from 'sweetalert2';
import 'react-calendar/dist/Calendar.css';
import './Compare.css'

function Compare(props) {
    const [value, onChange] = useState(new Date());
    const data1 = [
        {x: "10/24", y: 2},
        {x: "10/25", y: 5},
        {x: "10/26", y: 4},
        {x: "10/27", y: 1},
        {x: "10/28", y: 2},
        {x: "10/29", y: 3},
        {x: "10/30", y: 4}
    ], data2 = [
        {x: "10/24", y: 3},
        {x: "10/25", y: 4},
        {x: "10/26", y: 2},
        {x: "10/27", y: 3},
        {x: "10/28", y: 1},
        {x: "10/29", y: 2},
        {x: "10/30", y: 4}
    ]
    return (
        <main>
                <div id="main-container2">
                    <div className="header2">
                        <div className="title title2">
                            Compare
                        </div>
                    <div className="versus">
                        <span className="me">{ props.myName }</span>
                        <div className="vs">
                            <div className="v">V</div>
                            <div className="s">S</div>
                        </div>
                        <span className="friend">{ props.friendName }</span>
                    </div>
                    </div>

                    <div className="subdiv">

                        <p>Please select a period.</p>
                        <div className="calendar">
                        <label for="startdate">Start date</label>
                        <input type="date" name="startdate" value="2021-03-23" min="2019-01-01" max="2021-03-23" />
                        <label for="enddate">End date</label>
                        <input type="date" name="enddate" value="2021-03-23" min="2019-01-01" max="2021-03-23" />

                            {/* <Calendar
                                onChange = { onChange }
                                value = { value }
                            /> */}
                        </div>

                        <div className="chart">
                        <VictoryChart
                          animate={{
                            duration: 500,
                            onLoad: { duration: 500 }
                          }}
                          minDomain={
                              {y:0}
                          }
                          domainPadding={{x: [10, -10], y: 20}}
                          width={800}
                          height={500}
                          >
                            <VictoryLine
                                style={{ data: { stroke: "#B9EFC2", strokeWidth:5, strokeLinecap:"round" } }}
                                data={data2}
                                interpolation="natural"
                            />
                            <VictoryLine
                                style={{ data: { stroke: "#2C974B", strokeWidth:5, strokeLinecap:"round" } }}
                                data={data1}
                                interpolation="natural"
                                />
                        </VictoryChart>
                        </div>
                    </div>
                </div>
            </main>
    )

}

